import React from 'react';
import Heading from './Heading';
import Paragraph from './Paragraph'
import List from './List';
import {add, subs, multiflication, division} from './Calculation';


function App() {
	return(
		<>
			<Heading />
			<Paragraph />
			<List />

			<ul>
	         <li>{add(50, 5)}</li>
	         <li>{subs(55, 5)}</li>
	         <li>{multiflication(50, 5)}</li>
	         <li>{division(55, 7)}</li>
	       </ul>
		</>
		);
}

export default App;
